import React from "react";
import './Navigation'
import { NavLink } from "react-router-dom";
const Navigation = () => {
  return (
    <nav className="nav">
        <NavLink to='/'>Home</NavLink>
        <NavLink to='chat'>Chat</NavLink>
        <NavLink to='signup'>Sign up</NavLink>
        <NavLink to='login'>Login</NavLink>
    </nav>
  );
};

export default Navigation;
